            WriteLiteral(@""" />
            <h3>Structure of solution</h3>
            <p>Solution consists of 3 projects:</p>
            <ul>
                <li>RozetkaConsoleApp - for displaying all scraped data on console.</li>
                <li>Rozetka - has Model/Data classes and logic for scrapping</li>
                <li>ProductAnalysisWeb - ASP.NET project which con");
            WriteLiteral(@"sists of MVC (Home, E-Shop, Analytics pages), Razor Pages (Data, Top, Contact pages), Partial View and View Component.</li>
            </ul>
            <p>ProductAnalysisWeb has Layout which is shared between different pages</p><br />
            <p>Project has DataSource folder which is designated for</p>
            <ul>
                <li>storing extracted data from Rozetka;</li>
                <li>storing incoming messages after filling Contact form;</li>
                <li>storing list of subscribers' emails after filling subscriber form.</li>
            </ul>
            <h3>Menu Items Business & Technical description</h3>
            <ul>
                <li>
                    <b>E-Shop.</b> Data has been taken from XML file, previously scraped from Rozetka,
                    and displayed like in the Internet-Shop with relevant information and links to products in Rozetka.
                    <ul>
                        <li><b>Technical details:</b> Page uses MVC model where Controller pass");
            WriteLiteral(@"es the data from Model to the View. Bootstrap used for displaying data in a Grid and adding styles to the components.</li>
                    </ul>
                </li>
                <li>
                    <b>Analytics.</b> User can see maximum, minimum, average and median price. User can make search.
                    <ul>
                        <li>
                            <b>Technical details:</b> Page uses MVC model where Controller passes the data from Model to the View.
                            AngularJS used to show entered search criteria. JQuery used to show tooltips and for slideToogle.
                            Razor syntax is used to calculate the values. RenderSection as a Razor feature is used for footer, especially for changing some blocks depending on routing.
                        </li>
                    </ul>
                </li>
                <li>
                    <b>Data.</b> User can see data about mobiles in a table view. 2 widgets are present: one for display");
            WriteLiteral(@"ing the most expensive mobiles and second - the most popular mobiles.
                    <ul>
                        <li>
                            <b>Technical details:</b> Page uses Razor model where file .cshtml.cs is linked to razor view .cshtml.
                            First widget uses Partial View from the separate file, second uses View Component where Default.cshtml is used as a Razor view and the separate class as model.
                        </li>
                    </ul>
                </li>
                <li>
                    <b>Top.</b> 2 same widgets are present: one for displaying the most expensive mobiles and second - the most popular mobiles.
                    <ul>
                        <li>
                            <b>Technical details:</b> These 2 widgets are shared between this page and Top page. View Component enable to see different amount of the most popular mobiles depending on page.
                        </li>
                    </ul>
                </li>");
            WriteLiteral(@"
                <li>
                    <b>Contact.</b> On the first form user can send a message which then will be saved in xml format in the folder. Using second form user can ""subscribe"" - his email will be added to list in txt format.
                    <ul>
                        <li>
                            <b>Technical details:</b> The first form has validation on the required fields and uses Model Binding.
                            Second form has separate OnPostSubscribe() method for handling request. After submiting each of the form and if validation has been passed then user will be redirected to another confirmation page.
                        </li>
                    </ul>
                </li>
            </ul>
